const achieveTitStyle = {
    '@media (max-width: 800px)': {
        achieve: {
            margin: '0 0 5vh 12vw',
            fontSize: '10vw'
          },
    },
    '@media (min-width: 800px)': {
        imag: {
            position: 'absolute',
            margin: '30vh 0 40vh 5vw',
            height: '70vh',
        },
        achieve: {
            margin: '40vh 0 40vh 5vw',
            fontSize: '20vh',
            fontWeight: "600",
            textStrokeWidth: '3px',
            textStrokeColor: 'black',
            textFillColor: 'transparent',
            zIndex: '20',
            transition: '500ms',
        },
        achieveb: {
            position: 'absolute',
            margin: '40vh 0 40vh 5vw',
            fontSize: '20vh',
            fontWeight: "600",
            textStrokeWidth: '3px',
            textStrokeColor: 'black',
            textFillColor: 'black',
            transition: '500ms',
            zIndex: '10'
        },
    }
};

export default achieveTitStyle;
